import React from "react";
import "./MainMenu.css";
import Link from "react-router-dom";


function MainMenu() {
    return (
        <div className="main-menu"> 
            <div className="main-menu__item">  
                <Link to="/feed">Feed</Link>
            </div>
        </div>    
    )        
}


export default MainMenu;
